import React from 'react';
import { motion } from 'framer-motion';
import CoffeeParticles from './CoffeeParticles';
import './Contact.css';

const Contact = () => {
  const contactMethods = [
    {
      icon: 'fas fa-envelope',
      title: 'Email',
      value: 'ttanton2001@gmail.com',
      link: 'mailto:ttanton2001@gmail.com',
      color: '#006241',
      description: 'Send me a direct email'
    },
    {
      icon: 'fas fa-phone',
      title: 'Phone',
      value: '+1 (669) 203-7383',
      link: 'tel:+16692037383',
      color: '#28a745',
      description: 'Call me directly'
    },
    {
      icon: 'fab fa-linkedin',
      title: 'LinkedIn',
      value: 'linkedin.com/in/tanthatthienton',
      link: 'https://www.linkedin.com/in/tanthatthienton/',
      color: '#0077b5',
      description: 'Connect professionally'
    },
    {
      icon: 'fab fa-github',
      title: 'GitHub',
      value: 'github.com/TinTinTheGuy',
      link: 'https://github.com/TinTinTheGuy',
      color: '#333',
      description: 'View my projects'
    }
  ];

  const quickActions = [
    {
      icon: 'fas fa-download',
      title: 'Download Resume',
      description: 'Get my professional resume in PDF format',
      action: () => window.open('/resume/Resume.pdf', '_blank'),
      color: '#006241',
      gradient: 'linear-gradient(135deg, #006241, #004d33)'
    },
    {
      icon: 'fas fa-certificate',
      title: 'View Certifications',
      description: 'See my professional credentials and achievements',
      action: () => document.getElementById('resume').scrollIntoView({ behavior: 'smooth' }),
      color: '#8B4513',
      gradient: 'linear-gradient(135deg, #8B4513, #A0522D)'
    },
    {
      icon: 'fas fa-coffee',
      title: 'Coffee Chat',
      description: 'Let\'s discuss opportunities over coffee',
      action: () => window.open('mailto:ttanton2001@gmail.com?subject=Coffee Chat Request', '_blank'),
      color: '#FF6B35',
      gradient: 'linear-gradient(135deg, #FF6B35, #FF8C42)'
    }
  ];

  return (
    <section id="contact" className="contact">
      <CoffeeParticles count={1} />
      <div className="container">
        <motion.h2 
          className="section-title"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
        >
          Let's Connect â˜•
        </motion.h2>
        <motion.p 
          className="section-subtitle"
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          transition={{ delay: 0.2 }}
          viewport={{ once: true }}
        >
          Ready to discuss opportunities? Here's how to reach me
        </motion.p>

        <div className="contact-content">
          <motion.div 
            className="contact-info-section"
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            <div className="section-header">
              <div className="header-icon">
                <i className="fas fa-address-book"></i>
              </div>
              <div className="header-content">
                <h3>Contact Information</h3>
                <p>Get in touch through your preferred method</p>
              </div>
            </div>

            <div className="contact-cards">
              {contactMethods.map((method, index) => (
                <motion.div 
                  key={method.title}
                  className="contact-card"
                  initial={{ opacity: 0, y: 20 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ delay: index * 0.1 }}
                  viewport={{ once: true }}
                  whileHover={{ y: -5, scale: 1.02 }}
                >
                  <div className="card-icon" style={{ background: method.color }}>
                    <i className={method.icon}></i>
                  </div>
                  <div className="card-content">
                    <h4>{method.title}</h4>
                    <p className="card-description">{method.description}</p>
                    {method.link ? (
                      <a href={method.link} target="_blank" rel="noopener noreferrer" className="card-link">
                        {method.value}
                        <i className="fas fa-external-link-alt"></i>
                      </a>
                    ) : (
                      <span className="card-value">{method.value}</span>
                    )}
                  </div>
                </motion.div>
              ))}
            </div>
          </motion.div>

          <motion.div 
            className="quick-actions-section"
            initial={{ opacity: 0, x: 50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            <div className="section-header">
              <div className="header-icon">
                <i className="fas fa-bolt"></i>
              </div>
              <div className="header-content">
                <h3>Quick Actions</h3>
                <p>Get what you need instantly</p>
              </div>
            </div>

            <div className="actions-grid">
              {quickActions.map((action, index) => (
                <motion.button
                  key={action.title}
                  className="action-card"
                  onClick={action.action}
                  initial={{ opacity: 0, y: 20 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ delay: index * 0.1 }}
                  viewport={{ once: true }}
                  whileHover={{ scale: 1.05, y: -5 }}
                  whileTap={{ scale: 0.95 }}
                  style={{ '--action-gradient': action.gradient }}
                >
                  <div className="action-icon">
                    <i className={action.icon}></i>
                  </div>
                  <div className="action-content">
                    <h4>{action.title}</h4>
                    <p>{action.description}</p>
                  </div>
                  <div className="action-arrow">
                    <i className="fas fa-arrow-right"></i>
                  </div>
                </motion.button>
              ))}
            </div>

            <motion.div 
              className="availability-card"
              initial={{ opacity: 0 }}
              whileInView={{ opacity: 1 }}
              transition={{ delay: 0.5 }}
              viewport={{ once: true }}
            >
              <div className="availability-header">
                <div className="status-indicator">
                  <div className="status-dot"></div>
                  <span>Available for new opportunities</span>
                </div>
              </div>
              <div className="availability-content">
                <h4>Open to Collaboration</h4>
                <p>I'm currently open to networking, collaboration, and new professional opportunities. Let's discuss how we can work together!</p>
                <div className="availability-tags">
                  <span className="tag">Networking</span>
                  <span className="tag">Collaboration</span>
                  <span className="tag">New Projects</span>
                </div>
              </div>
            </motion.div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default Contact;
